import { useState } from "react";
import CardPizza from "sections/CardPizza";

const HomePage = () => {

  const [pizzas, setPizzas] = useState<Pizza[]>([
    { id: 1, title: 'Pizza Thit Bam', description: 'Thit bam, so ca chua' },
    { id: 2, title: 'Pizza Pho Mai', description: 'Pho mai, muoi' },
    { id: 3, title: 'Pizza Hai San', description: 'Tom, cua' },
  ])

  return (
    <div style={{ height: 'calc(100vh - 309px)', padding: '4rem 4rem', overflowY: 'auto' }}>
      <div className="wrapper-card-items">
        {
          pizzas.map(item => <CardPizza title={item.title} description={item.description} />)
        }
      </div>
    </div>
  )
};

export default HomePage;
